style.css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

/* tab icon */
tab [src*='4chan.org'],
#page-proxy-favicon[src$="4chan.org/favicon.ico"],
tab[image$="4chan.org/favicon.ico"] .tab-icon,
.bookmark-item[statustext*="4chan"] .menu-iconic-icon,
.bookmark-item[statustext*="4chan"] .toolbarbutton-icon,
.bookmark-item[image*="4chan.org"]:not([container]) .menu-iconic-icon,
.bookmark-item[image*="4chan.org"]:not([container]) .toolbarbutton-icon {
  width: 0 !important;
  padding-left: 16px !important;
  background: transparent url("data:image/x-icon;base64,") center center no-repeat !important;
}

@-moz-document domain(4chan.org) {/*
  Nothing. This is just to make this style appear
  on Stylish icon context menu if the active tab
  is 4chan.org */
}
